import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Hi.
        </p>
        <a
          className="App-link"
          href="https://ception.ch"
          target="_blank"
          rel="noopener noreferrer"
        >
          my website.
        </a>
      </header>
    </div>
  );
}

export default App;
